import { __decorate } from "tslib";
import { Component } from '@angular/core';
let LaboralComponent = class LaboralComponent {
    constructor(sisgerhService, authService, cookieService) {
        this.sisgerhService = sisgerhService;
        this.authService = authService;
        this.cookieService = cookieService;
    }
    async ngOnInit() {
        this.inPer = localStorage.getItem('usuario');
        console.log(this.inPer);
        let response = await this.sisgerhService.obternerInformacionPer(btoa(this.inPer)).toPromise();
        console.log(response);
        // this.informacion=[''];
        // .subscribe(res=>{
        //   this.informacion=res;
        //   this.informacion=this.informacion[0];
        //   console.log(this.informacion)
        // });
        // this.tiempo = ['']
        // this.sisgerhService.obtenerTiempoServicio(btoa(this.inPer)).subscribe(res => {
        //   this.tiempo = res
        // })
    }
    obtenerInformacion() {
        this.inPer = localStorage.getItem('usuario');
        this.informacion = [''];
        this.sisgerhService.obternerInformacionPer(btoa(this.inPer)).subscribe(res => {
            this.informacion = res;
            this.informacion = this.informacion[0];
        });
        this.tiempo = [''];
        this.sisgerhService.obtenerTiempoServicio(btoa(this.inPer)).subscribe(res => {
            this.tiempo = res;
        });
    }
};
LaboralComponent = __decorate([
    Component({
        selector: 'app-laboral',
        templateUrl: './laboral.component.html',
        styleUrls: ['./laboral.component.css']
    })
], LaboralComponent);
export { LaboralComponent };
